import React, { useState, useEffect } from 'react';

import './Menu.css';

import Header from '../Header/Header';

export default function MainComponent(props) {     
    return (
        <div className="app-wrapper">
            <Header/>

            <div className="component-wrapper">                     
                {props.children}
            </div>
        </div>
    );
  }
